"use strict";
function xmlrpcWrapper(conf) {
  return new Promise((resolve, reject) => {
    $.xmlrpc(conf).then(
      function (response, status, xhr) {
        resolve({
          response,
          status,
          xhr,
        })
      },
      function (jqXHR, status, error) {
        reject({
          jqXHR,
          status,
          error,
        })
      }
    )
  })
}

